INSERT INTO `users` VALUES (14,'NUEVA MENTE PSICOLOGOS','info@nuevamentepsicologos.com','951325269','nuevamentepsicologos.com','Gabinete Psicológico','81dc9bdb52d04dc20036dbd8313ed055','2023-05-31 12:15:58',1),(15,'FRANCISCO JOSE DEL RIO VELARDE','f.delrio.velarde@gmail.com','625376988',NULL,'ADMINISTRADOR','f813c705499c56d8cbce9349879dc048','2023-06-07 19:50:00',1),(17,'PsicoAbreu','info@psicologos-malaga.com','672404040','psicologos-malaga.com','En PsicoAbreu ofrecemos un servicio de atención psicológica de Calidad, guiado por los mejores psicólogos en Málaga especializados en Psicología Clínica y altamente cualificados que, mediante una terapia psicológica integradora eficaz, ayudan a resolver todas aquellas cuestiones Psicológicas que te afectan.','ea91daca3517315d59181f9b4823414b','2023-06-21 12:39:19',1),(18,'Zentra2','info@zentrados.com','951985638','zentra2.com','Zentra2 Psicología inició su recorrido en 2013. Ubicado en el centro de Málaga ha ido desarrollando su actividad en diferentes áreas profesionales dentro del campo de la psicología.\nEn sus inicios nos centramos en la Psicología Clínica atendiendo a niños, adolescentes y adultos','ea91daca3517315d59181f9b4823414b','2023-06-21 12:45:10',1),(19,'Mas Vida Psicologos','info@mas-vida-psicologos-malaga.com','675115042','mas-vida-psicologos-malaga.com','En Más Vida Psicólogos Málaga estamos encantados de ofrecerte nuestra experiencia y toda la ayuda psicológica que precises. Disponemos de tratamientos novedosos y muy eficaces en el campo de la psicología clínica, cognitiva y social. Lo que sin duda te ayudará a superar cualquier situación emocional por la que estés atravesando.','ea91daca3517315d59181f9b4823414b','2023-06-21 12:58:10',1),(20,'Desiree Infante Psicologa','psicologadesireeinfante@gmail.com','600977310','psicologadesireeinfante.com','Psicólogos en Málaga especialistas en psicología Sanitaria y Neuropsicóloga. Disponemos de un gabinete de psicología equipado con la infraestructura y profesionales necesarios para abordar todo tipo de problemas psicológicos que pueda estar sufriendo. Pide cita con nuestro equipo de psicólogos para llevar a cabo un diagnóstico y tratamiento personalizado específico para su caso.','ea91daca3517315d59181f9b4823414b','2023-06-21 13:02:29',1),(21,'Valpe Psicologos','valpepsicologos@gmail.com','656430111','psicologiamalagacentro.com','En Valpe Psicólogos queremos ayudarte a alcanzar tus objetivos personales con herramientas prácticas, provenientes de la psicología basada en la evidencia. Olvídate de los mitos en torno a “ir a terapia”: Vivirás una experiencia agradable dónde descubrirás mucho sobre tí.\nHemos trabajado con cientos de personas y entendemos las complejidades y las dificultades que las personas encuentran en la actualidad. Los últimos avances en psicología y nuestro trato cercano son los elementos clave que te ayudarán a encontrarte mejor.','ea91daca3517315d59181f9b4823414b','2023-06-21 13:08:35',1),(22,'Gabinete de Psicologia Málaga Javier Alvarez','GABINETEDEPSICOLOGIAMALAGA@GMAIL.COM',' 618058800','GABINETEDEPSICOLOGIAMALAGA.COM','Como psicólogo en Málaga, para nosotros la palabra “cambio” es casi como un mantra en psicología, algo que intentamos transmitir en sesión a través de metáforas, dichos populares, esquemas, dibujos o lo que sea necesario. “No se puede sacar agua de un pozo seco”, “Si has realizado una acción 50 veces qué te hace pensar que si esta semana hacemos la 51 obtendremos resultados”…, y así varias por el estilo según el día y la persona con la que esté trabajando.\nPorque el cambio, es mejora, la mejora, calidad de vida y salud mental.','ea91daca3517315d59181f9b4823414b','2023-06-21 13:14:36',1),(23,'Salutis Centro Psicólogos Málaga ','info@salutiscentro.com','600023300','https://www.psicologosmalagasalutiscentro.com','Los psicólogos Málaga de Salutis Centro plantean nuevas alternativas a los pensamientos y patrones de conducta, motivando al cambio para que las personas aprendan a potenciar lo mejor de sí mismas.\nAcudir a Salutis Centro Psicólogos Málaga, le proporcionará un espacio donde podrá exponer su problema o dificultad y aprender a solucionarlo, potenciando sus puntos fuertes y manejando las propias limitaciones.','ea91daca3517315d59181f9b4823414b','2023-06-21 13:19:01',1),(24,'Lola Escalante Estudio Dental','info@estudiodentalescalante.es','633587193','https://estudiodentalescalante.es','En LOLA ESCALANTE ESTUDIO DENTAL estamos especializados en odontología estética y podemos ayudarte a conseguir la sonrisa que siempre has deseado. Tu Clínica Dental en Málaga.\nEntendemos que las necesidades dentales de cada persona son únicas. Por eso en nuestra clínica, la Dra. Lola Escalante, Dentista en Málaga, ofrecemos una amplia gama de tratamientos dentales a nuestros pacientes.','ea91daca3517315d59181f9b4823414b','2023-06-21 15:44:08',1),(25,'Grupo Dental Clinic','info@grupodentalclinic.com','601442813','https://www.grupodentalclinics.es/','Con la garantía de saber que detrás te esperan los mejores dentistas en Andalucía. Un equipo de odontólogos y cirujanos maxilofaciales de primer nivel, dirigido por la Doctora Hanane Maalaoui y el Doctor Ariel Bilbao Góngora. \nCon la garantía de acceder a unas instalaciones pensadas para tu confort y para ofrecerte un servicio odontológico de máxima calidad. Con materiales de alta gama y tecnología punta.','ea91daca3517315d59181f9b4823414b','2023-06-21 15:52:39',1),(26,'Naturadent','info@naturadent.com','952265185','https://naturadent.es','Somos una clínica que lucha por una odontología verdadera, sin mentiras, sin tratamientos que no necesitas, a precios competentes, con facilidades de pagos sin intereses, con odontólogos destacados dentro del gremio, con especialistas con masters. Con la mejor tecnología.','ea91daca3517315d59181f9b4823414b','2023-06-21 16:22:12',1),(27,'Crooke Laguna Dental Clinic','malaga@crooke.net','952229192','https://www.clinicadentalcrookelaguna.com','Bienvenido a Crooke & Laguna, la Clínica Dental donde le ayudaremos a obtener una sonrisa soñada y saludable.\nContamos con profesionales expertos con más de 20 años de experiencia, especializados en diferentes campos para que tu tratamiento sea 100% personalizado desde principio a fin.','ea91daca3517315d59181f9b4823414b','2023-06-21 18:03:58',1),(28,'Gross Dentistas','info@grossdentistas.com',' 649965932','https://www.clinicadentalgrossdentistas.com','Nuestra clínica principal está ubicada en Málaga, cuenta con 350 metros cuadrados y está provista de tecnología de diagnóstico para tratamientos dentales de última generación.\nEn todas nuestras clínicas ofrecemos el mismo servicio de compromiso, calidad y profesionalidad en tratamientos dentales, urgencias y cirugías.','ea91daca3517315d59181f9b4823414b','2023-06-21 18:09:24',1),(29,'B&B Dental','info@bybdental.com',' 722239076','https://bybdental.com','Sabemos que no es el mejor plan ir al dentista , pero es necesario, por eso tratamos que venir a nuestra clínica dental sea lo más agradable posible. Para ello ofrecemos un trato cercano y especial a cada paciente.','ea91daca3517315d59181f9b4823414b','2023-06-21 18:16:39',1),(30,'Prodentis Clinicas Dentales','info@prodentis.es','952392070','https://prodentis.es','En nuestras diferentes clínicas dentales estará en las mejores manos, recibirá las técnicas diagnósticas y terapéuticas más avanzadas, y será tratado por un equipo de dentistas de primer nivel. Profesionales del primer nivel en el sector que llevan años de experiencia en su carrera profesional. ','ea91daca3517315d59181f9b4823414b','2023-06-21 18:23:41',1),(31,'Cuomax','info@cuomax.com','951550450','https://cuomax.com','CUOMAX está formado por especialistas de alto nivel reconocidos en sus especialidades de odontología y cirugía maxilo facial.\nNuestra clínica está equipada con la tecnología más innovadora para formar profesionales en las técnicas y tratamientos de última generación.','ea91daca3517315d59181f9b4823414b','2023-06-21 18:29:30',1),(32,'Clinica Poyatos','info@clinicapoyatos.com','621216252','https://clinicapoyatos.com','Desde 1965 ofrecemos tratamientos de podología para patologías o lesiones tanto propias del pie, como a nivel del resto del aparato locomotor de nuestros pacientes.','ea91daca3517315d59181f9b4823414b','2023-06-21 18:43:10',1),(33,'Escaño Clinica Podologica','podologiaescano@gmail.com','951107277','https://malagapodologica.com','Bienvenidos a Clínica Podológica Escaño, su clínica podólogica en Málaga.\nMás de ocho años pendientes de la salud podológica general de sus pies, tratando cualquier alteración en la piel o morfológica del pie, preocupándonos por un correcto desarrollo del pie infantil para que pisen seguros toda la vida que tienen por delante, tratando con especial cuidado los pies que han guiado toda una vida en la tercera edad.','ea91daca3517315d59181f9b4823414b','2023-06-21 18:49:53',1),(34,'Clinica Podologica Medina','info@clinicapodologicamedina.com','952653813','https://www.clinicapodologicamedina.com','Clinica Podologica Medina inicia su actividad a principios de 2001.Con un objetivo fundamental, ofrecer a nuestros clientes una asistencia integral en el cuidado de los pies.','ea91daca3517315d59181f9b4823414b','2023-06-21 18:56:20',1),(35,'Podozone','info@podozone.es','673097665','https://www.podozone.es','En clínica Podozone estamos al día de las últimas técnicas en tratamientos para ofrecer al paciente lo más adecuado a cada caso de forma personalizada','ea91daca3517315d59181f9b4823414b','2023-06-21 19:13:02',1),(37,'Clinica del Pie ','info@podologiademalaga.com','952042247','http://podologiademalaga.com','En Clínica del Pie la Unión nos preocupamos por resolver cada una de las patologías que nos encontramos en nuestro día a día desde el inicio de la actividad en 2002. Para ello contamos con modernas instalaciones y diversa aparatología, así cómo un proceso contínuo de formación y estudio en los nuevos avances para solventar todo tipo de problemas que afecten a la salud de nuestros pies y una estrecha colaboración con otros profesionales acreditados en biomecánica deportiva, infantil y cirugía podológica.','ea91daca3517315d59181f9b4823414b','2023-06-21 19:42:21',1),(38,'Centro de Podologia Larios','rosa.navaslopez@gmail.com','952221123','https://www.centrodepodologialarios.com','Somos Podología Larios, un centro de podología que cuenta con más de 30 años de experiencia en la localidad de Málaga. Ofrecemos los mejores tratamientos de podología.','ea91daca3517315d59181f9b4823414b','2023-06-21 20:33:06',1),(39,'Podologia Semedi','info@podologiasemedi.com','952284316','https://podologiasemedi.com','Es muy probable que ya nos conozcas, ya que son muchísimas las personas que han depositado su confianza en nosotros para que nos ocupemos del cuidado y la salud de sus pies. Pero si no es así,  estaremos encantados de recibirte y atender tus necesidades con la profesionalidad que nos caracteriza.','ea91daca3517315d59181f9b4823414b','2023-06-21 20:39:43',1),(40,'Clinica Manzano','info@clinicamanzano.es','952616080','clinicamanzano.es','Nuestra misión es mejorar la salud y el bienestar de nuestros pacientes poniendo a su disposición las últimas técnicas y tratamientos en cada una de nuestras áreas.\nTrabajamos por y para nuestros pacientes ofreciendo un servicio de calidad, personalizado y adaptado a las necesidades de cada uno.','ea91daca3517315d59181f9b4823414b','2023-06-22 09:09:50',1),(41,'Fisioterapia y Osteopatia Victor Lluch','info@fisiolluch.com','722643148','https://fisiolluch.com','Dando lo mejor de nosotros a nuestros pacientes desde el año 2009.\nOfrecemos a nuestros pacientes un servicio de calidad, personalizado y siempre con la mayor profesionalidad.','ea91daca3517315d59181f9b4823414b','2023-06-22 09:38:37',1),(42,'Hiris Centro de Fisioterapia Integral','info@hiris.es','608907362','https://www.hiris.es','En Hiris, disponemos de diferentes salas para llevar a cabo los tratamientos fisioterapéuticos. Además en nuestra clínica fisioterapia Málaga tenemos los aparatos más novedosos para la perfecta realización de los tratamientos de ultrasonidos, electroestimulación, microondas, magnetoterapia y ondas de choques a nuestros pacientes.','ea91daca3517315d59181f9b4823414b','2023-06-22 09:44:50',1),(43,'Alejandro Molina Fisioterapia','a.molina@ammfisioterapia.es','951212821','https://www.clinicafisioterapiaenmalaga.es','Cada paciente es único, así como el tratamiento que necesita.\nCreemos firmemente que no existe una sola manera de tratar a un paciente\nsino que a través de la combinación de diferentes técnicas conseguimos\nsolucionar, de manera más global, los problemas de salud del paciente,\ninsistiendo en sus necesidades y personalizando el tratamiento.','ea91daca3517315d59181f9b4823414b','2023-06-22 09:50:29',1),(44,'Union Salud','contacto@unionsalud.es','666247619','https://unionsalud.es','Unión Salud es un centro de fisioterapia ubicado en calle La Unión, en Málaga capital. A pesar de ser un centro de nueva creación, sus profesionales llevan años formándose para aportar lo mejor de ellos mismos a cada paciente. Son varios años y miles de pacientes los que los avalan.','ea91daca3517315d59181f9b4823414b','2023-06-22 09:55:27',1),(45,'Fisio Cer','info@fisiocer.es','622020601','https://fisiocer.es','FisioCer – Clínica de Fisioterapia Deportiva y Rehabilitación en Málaga es un centro de fisioterapia en constante evolución y centrado en las necesidades del paciente. Somos expertos en todo tipo de lesiones deportivas y no deportivas, biomecánica y ecografía, ofreciendo además tratamientos complementarios para reducir el dolor y optimizando la recuperación.','ea91daca3517315d59181f9b4823414b','2023-06-22 10:01:54',1),(46,'Fisio Expert Centro de fisioterapia','info@fisioexpert.com','640295720','https://fisioexpert.com','Somos una Clínica de Fisioterapia en Málaga desde donde trabajamos cada día para ayudarte a mejorar su salud. En Fisioexpert encontrarás los servicios de fisioterapia más especializados y profesionales. Si estás buscando una clínica de fisioterapia en Málaga o un fisioterapeuta en Málaga, ¡has llegado al lugar adecuado!','ea91daca3517315d59181f9b4823414b','2023-06-22 10:22:13',1),(47,'Interfisio fisioterapia','info@interfisio.es',' 625422082','https://interfisio.es','\nEl beneficio de elegir Interfisio como centro de confianza no es exclusivamente hacer que tus lesiones desaparezcan. Acudir a buenos profesionales significa que te van a ayuda a entender tu lesión y evitar que vuelva a aparecer.','ea91daca3517315d59181f9b4823414b','2023-06-22 10:26:54',1),(48,'Fisuma fisioterapia y salud','info@fisumasalud.com','689114253','https://www.fisumasalud.com','En nuestro centro de fisioterapia de Málaga contamos con un equipo de fisioterapeutas colegiados con gran experiencia en la realización de tratamientos específicos para mejorar el bienestar de nuestros pacientes.','ea91daca3517315d59181f9b4823414b','2023-06-22 10:32:27',1),(49,'Fisioterapia Vida','info@fisioterapiavida.com',' 650593380','https://fisioterapiavida.com','La mayoría de personas piensan que los masajes son solo para el ocio, estética y relajación; nada más lejos de la realidad. Aunque recibir sesiones de masajes te aporta ese bienestar relajante no hay que pasar por alto los beneficios médicos y saludables que te aportan. Tu sesión de masajes en Málaga con facilidades, en nuestro centro o en tu domicilio. ¡No solo te sentirás relajado como mereces, sino que tu salud también te lo agradecerá!','ea91daca3517315d59181f9b4823414b','2023-06-22 10:39:07',1),(50,'Reformando baños ','reformandomalaga@gmail.com','600720487','https://reformandomalaga.com','Desde REFORMANDO BAÑOS MÁLAGA apreciamos enormemente la opinión de nuestros clientes pues es lo que nos hace mejorar y estar siempre atentos a vuestras peticiones.','ea91daca3517315d59181f9b4823414b','2023-06-22 11:01:11',1),(51,'Reformas integrales Malaga','presupuesto@reformas-integrales-malaga.com','657215310','https://reformas-integrales-malaga.com','Somos especialistas en la construcción de propiedades únicas y exclusivas. Nuestro trabajo inspira. Nos enorgullecemos de ofrecer calidad y diseño excepcionales para clientes líderes en toda la provincia de Málaga.','ea91daca3517315d59181f9b4823414b','2023-06-22 11:08:56',1),(52,'Pivasa Construcciones','info@pivasaconstrucciones.es',' 660094642','https://www.pivasaconstrucciones.es','Somos una empresa de Málaga especializada en reformas integrales, proyectos de rehabilitación de fachadas y restauración de edificios, construcción de viviendas, comunidades y oficinas. Con nosotros tendrás a tu disposición a un equipo con gran experiencia que te ayudará y asesorará en todo lo que necesites.','ea91daca3517315d59181f9b4823414b','2023-06-22 11:14:36',1),(53,'Reformas Francisco Paz','info@reformasfranciscopaz.com','659930887','https://www.reformasfranciscopaz.es','Reformas Francisco Paz es una empresa malagueña fundada en el año 2000, que trabaja en el sector de la construcción, ofreciéndole todos sus servicios con la mejor eficacia y garantía de calidad del mercado.','ea91daca3517315d59181f9b4823414b','2023-06-22 11:20:25',1),(54,'Hola Reformas','cuentame@holareformas.com','611513449 ','https://holareformas.com',' ¿Alguna vez has escuchado?; “Una casa dice mucho de su dueño”. Y tanto que es así, y por eso, nosotros no paramos hasta que tu proyecto lo convirtamos en lo que tú quieres, esforzándonos a tope para llegar a la perfección hasta en el último detalle.','ea91daca3517315d59181f9b4823414b','2023-06-22 11:26:12',1),(55,'Arion Arquitectura tecnica y Construccion','info@arionarquitectura.com','607848658','https://arionarquitectura.com','En ARIÓN Arquitectura Técnica y Construcción, ayudamos a los estudios de arquitectura, promotores y particulares a llevar un control económico, de plazos y de  calidad de sus proyectos.','ea91daca3517315d59181f9b4823414b','2023-06-22 11:31:15',1),(56,'Arema Reformas Integrales','info@reformasarema.es','663141404','https://reformasarema.es','Toda nuestra experiencia al servicio del cliente. \nEstamos siempre a la vanguardia de los materiales más actuales y tecnologías que facilitan la puesta en marcha de su proyecto.','ea91daca3517315d59181f9b4823414b','2023-06-22 11:44:44',1),(57,'Fluinsa','info@fluinsa.es','952246271','https://www.reformasyconstructorasmalaga.es','Fluinsa: La empresa de referencia especializada en reformas.\nSi estás buscando una empresa de reformas profesional, seria, comprometida y con buenos precios estás en el sitio adecuado. Solicita tu presupuesto sin compromiso o contáctanos y te resolveremos cualquier duda.','ea91daca3517315d59181f9b4823414b','2023-06-22 11:49:34',1),(58,'Remorfas Tovar Mantenimiento','reformastovar@reformastovar.es','665894507','http://www.reformastovar.es','En Reformas Tovar somos más que una empresa de reformas: brindamos una amplia cobertura de servicios en el ámbito de las reformas, el mantenimiento, la construcción e instalación y reparación de elementos. Todos los trabajos son realizados a medida para cada cliente, siendo nuestra especialidad lo que llamamos como proyecto llave en mano. A partir de tu idea, nosotros nos encargamos de diseñarla desde cero y ejecutarla, incluyendo la instalación de mobiliario y elementos si así lo deseas.','ea91daca3517315d59181f9b4823414b','2023-06-22 11:57:52',1),(59,'Living Kits','info@livingkits.com','951286646','https://livingkits.com','Somos un equipo multidisciplinar de profesionales dedicados al sector de la construcción ecoeficiente con materiales de primera calidad con una amplia trayectoria.','ea91daca3517315d59181f9b4823414b','2023-06-22 12:04:18',1),(60,'B Edificacion','hola@bedificacion.es','951105542 ','https://bedificacion.es','El Equipo de B Edificación Arquitectos, está compuesto por técnicos especializados en arquitectura y edificación, además colaboramos con varias empresas del sector,','ea91daca3517315d59181f9b4823414b','2023-06-22 12:12:22',1),(61,'HCP Arquitectos','malaga@hcparquitectos.com','952227707','https://hcparquitectos.com','HCP es una empresa de consultoría multidisciplinaria que ofrece arquitectura, ingeniería y planificación urbana. Hemos llevado a cabo más de 2.700 proyectos en más de 30 países.','ea91daca3517315d59181f9b4823414b','2023-06-22 12:18:07',1),(62,'Manuel Navarro Arquitecto','manuelnavarro@arquitecturamalaga.es','952073988','https://arquitectomanuelnavarro.es','Muchos años de experiencia avalan al estudio de arquitectura de Manuel Navarro en las diferentes tareas que a continuación se detallan. Tenemos pasión por la arquitectura y por el trabajo bien hecho, por eso nuestro equipo multidisciplinar siempre dará lo mejor de sí para conseguir que los trabajos salgan con el mejor resultado y en unos plazos de tiempo muy ajustados.','ea91daca3517315d59181f9b4823414b','2023-06-22 12:23:27',1),(63,'Kubo Architecture & Engineering','comercial@kuboarquitectos.es','951204805','https://www.kuboarquitectos.es','KUBO pone a tu disposición un equipo de arquitectos profesionales, expertos en gestión y diseño de viviendas unifamiliares','ea91daca3517315d59181f9b4823414b','2023-06-22 12:32:24',1),(64,'Dika Estudio','dika@dikaestudio.com','633480611','https://www.dikaestudio.com','Somos un estudio creativo integral y multidisciplinar, practicamos la Arquitectura del diseño, como arquitectos llevamos las lógicas y técnicas de la arquitectura a los campos del diseño y la creatividad generando soluciones únicas y emocionantes. Para ello contamos con un equipo multidisciplinar (diseñadores, arquitectos, infografistas, interioristas, técnicos, ingenieros, artesanos…) unidos bajo la misma guía, entorno a una idea de proyecto única, diseñada para materializar tus sueños e ideas iniciales. En DIKA estudio, juntos construimos tus sueños.\n','ea91daca3517315d59181f9b4823414b','2023-06-22 12:38:48',1),(65,'Gana Arquitectura','info@galisteonavarro.com',' 951393763','http://ganaarquitectura.com','GANA arquitectura nace con el único propósito de mejo