ción práctica y de calidad. ','ea91daca3517315d59181f9b4823414b','2023-06-23 15:47:56',1),(111,'Academia Omega','info@academiaomega.com','638445763','https://www.academia-omega.com','Porque desde 1987 nos caracteriza el rigor, la seriedad, la experiencia y el compromiso de todo el personal de nuestro centro. Te sentirás rodeado de profesionales que darán soluciones a las cuestiones que te vayan surgiendo. Y lo más importante: tus profesores te harán sentir seguro durante todo el curso.','ea91daca3517315d59181f9b4823414b','2023-06-23 15:54:24',1),(112,'SmartFit','info@smartfit.es','910184467','https://smartfit.es','Somos una empresa que nace en 2013 con una vocación muy marcada dentro del sector del fitness, utilizar la experiencia adquirida gestionando grandes proyectos deportivos por parte de un joven equipo de profesionales para crear instalaciones acordes a las nuevas preferencias y hábitos de los usuarios.','ea91daca3517315d59181f9b4823414b','2023-06-23 16:16:05',1),(113,'Distrito 290 Malaga','info@distrito290larios.com','649814188','https://distrito290malagalarios.com','Distrito 290 Málaga Larios es mucho más que un gimnasio. Somos una boutique de entrenamiento centrada en la salud de las personas donde disfrutarás de todas las comodidades para que entrenes a gusto.','ea91daca3517315d59181f9b4823414b','2023-06-23 16:28:32',1),(114,'Brooklyn Fitboxing','pacificomalaga@brooklynfitboxing.com','608265097','https://www.brooklynfitboxing.com','Una manera diferente de hacer deporte. Alternamos rounds de golpeo al saco al ritmo de la música con ejercicios funcionales.\r\nTrabajamos cardio y fuerza. La manera más eficaz de tonificar y perder grasa. ','ea91daca3517315d59181f9b4823414b','2023-06-23 16:38:59',1),(115,'Synergym','info@synergym.es','625334085','https://synergym.es','Fundada en Málaga en 2013, Synergym es uno de los principales operadores de gimnasios de España.\r\nActualmente, y en un periodo de tiempo récord, somos unas de las grandes cadenas de fitness a nivel nacional, y nuestra intención no es parar de crecer.\r\n','ea91daca3517315d59181f9b4823414b','2023-06-23 18:42:58',1),(116,'O2 Wellness Malaga','elperchel@o2cw.es','952363900','https://malaga.o2cw.es','\r\nEn nuestros centros encontrarás actividades dirigidas (centros oficiales Les Mills), group trainings y actividades en agua con las que estamos seguros encontrarás una actividad que se ajuste a tus gustos y/o necesidades.','ea91daca3517315d59181f9b4823414b','2023-06-23 18:56:11',1),(117,'NowFit Center','info@nowfitcenter.com','605748999','https://nowfitcenter.com','NowFIT nació en Málaga (España) el 29 de diciembre de 2016, bajo un nuevo concepto innovador en el cual unimos todas las características esenciales de los gimnasios de la vieja escuela, también llamados “gimnasios de barrio”, con las grandes superficies, también llamados “macrogimnasios” o “gimnasios franquicia”. ','ea91daca3517315d59181f9b4823414b','2023-06-23 19:05:06',1),(118,'Reebok Sport Center Malaga','info@reebokmalaga.com','952659004','https://reebokmalaga.com','Somos uno de los mejores gimnasios del Centro de Málaga, contamos con la última tecnología en equipamiento, máquinas con TV incorporado y Código QR, y los mejores servicios.Reebok Sport Center Málaga te ofrece una Sala de Fitness de más de 350 m2 con 17 puntos cardiovasculares, 16 máquinas de de musculación, 13 bancos de peso libre, 2 multipower, mancuerneros y gran variedad de barras y diversos materiales para complementar tu entrenamiento.','ea91daca3517315d59181f9b4823414b','2023-06-24 09:56:41',1),(119,'Training Time','info@gimnasiotrainingtime.com','744669955','https://gimnasiotrainingtime.com','Training Time es un gimnasio diferente creado y dirigido actualmente por dos jóvenes emprendedores cargados de ilusión con el objetivo principal de mejorar la calidad de vida de las personas mediante un trato cercano, profesional e individualizado.\r\n','ea91daca3517315d59181f9b4823414b','2023-06-24 10:01:54',1),(120,'Coleccion del Museo Ruso','info@colecciondelmuseoruso.com','687077118','https://www.coleccionmuseoruso.es','La visita virtual está creada en tres idiomas y permite realizar un viaje por todas las salas de la exposición, recibir información sobre cada pieza, admirar con detalle las obras maestras del artista y, además, ver obras que no se muestran habitualmente. Las audioguías en ruso, español e inglés ofrecen la posibilidad de conocer más a fondo las piezas más interesantes de la exposición.','ea91daca3517315d59181f9b4823414b','2023-06-24 10:12:18',1),(121,'Cac Malaga','cacmalaga@cacmalaga.eu',' 952208500','https://cacmalaga.eu','En el Departamento Pedagógico del CAC Málaga afianza y evoluciona en su línea iniciada en cursos anteriores: ser un Departamento dinámico y abierto, adaptado a las necesidades del profesorado y a los diseños curriculares de los diferentes niveles educativos.\r\n\r\nEl Programa Educativo que hemos elaborado para el presente curso escolar, cubre todos los niveles de la Enseñanza, desde Educación Infantil, Primaria, Secundaria, Bachillerato y Ciclos Formativos, hasta niveles universitarios.','ea91daca3517315d59181f9b4823414b','2023-06-24 10:25:53',1),(122,'Muacp Malaga','museoartespopulares@fundacionunicaja.com','  952217137','http://www.museoartespopulares.com','Decano de los museos privados de la ciudad de Málaga, el Museo Unicaja de Artes y Costumbres Populares encuentra sus antecedentes en los años sesenta, a la par de la inauguración del Museo de Bellas Artes (1961), concebido con dos secciones más: la arqueológica y la etnográfica.','ea91daca3517315d59181f9b4823414b','2023-06-24 10:30:30',1),(123,'Museo Carmen Thyssen Malaga','info@carmenthyssenmalaga.org',' 952217511','https://carmenthyssenmalaga.org','La transparencia y la participación son elementos que impregnan la actividad del Museo Carmen Thyssen. Los ciudadanos exigen y merecen disponer de toda la información sobre la actividad del Museo, ya no solamente por el carácter público de éste, sino también para poder implicarse en todas las actividades artísticas y culturales que dinamizamos.','ea91daca3517315d59181f9b4823414b','2023-06-24 10:36:33',1),(124,'Museo Revello de Toro','info@museorevellodetoro.net','952062069','https://www.museorevellodetoro.net','El Museo Revello de Toro está concebido como un espacio expositivo dotado de la más avanzada tecnología y que se propone cumplir tres objetivos. En primer lugar, su finalidad esencial es exponer permanentemente la cesión que el afamado retratista y pintor figurativo malagueño Félix Revello de Toro ha realizado a su ciudad natal. De las ciento cuarenta y dos obras se muestran al público ciento trece entre óleos, bocetos y dibujos que forman la colección permanente del Museo.','ea91daca3517315d59181f9b4823414b','2023-06-24 10:42:33',1),(125,'Principia Centro de Ciencia','info@principia-malaga.com','952070481','https://www.principia-malaga.com','PRINCIPIA es un centro de ciencia interactivo que se caracteriza por favorecer la divulgación científica y tecnológica a todo el público de forma amena, sin perder rigor en sus contenidos.\r\nEs interactivo porque existe una manipulación de los objetos que invita a pensar, reflexionar y experimentar, motivando al visitante a conocer e investigar por si mismo el fundamento científico de los fenómenos naturales del mundo que le rodea.','ea91daca3517315d59181f9b4823414b','2023-06-24 10:49:48',1),(126,'Museo Casa Natal Picasso','museocasanatalpicasso@malaga.eu','951926060','https://museocasanatalpicasso.malaga.eu','Pablo Ruiz Picasso (Málaga, 1881-Mougins, 1973) es unánimemente considerado como uno de los artistas más importantes de la historia del arte, y posiblemente el más influyente del siglo XX.\r\nPintor, dibujante, grabador, escultor, ceramista, diseñador teatral, escritor… una figura emblemática del arte moderno que demuestra su perenne actualidad por el número de exposiciones, publicaciones, investigaciones y noticias que sigue generando.','ea91daca3517315d59181f9b4823414b','2023-06-24 10:55:02',1),(127,'Centro Pompidou Malaga','info.centrepompidou@malaga.eu','951926200','https://centrepompidou-malaga.eu','El departamento de mediación está constituido por expertos en historia del arte y bellas artes, casi todos con intereses en áreas transversales al mismo: historia cultural y social del arte, filosofía, antropología, sociología, práctica artística y otras expresiones del arte. Estos conocimientos dan gran diversidad a las visitas mediadas, haciendo de cada una de ellas una experiencia única.','ea91daca3517315d59181f9b4823414b','2023-06-24 11:06:35',1),(128,'Adendia Inmobiliaria','ventas@adendia.com','639584294','https://adendia.com','En Adendia somos veteranos en el mundo de la gestión inmobiliaria.\r\nDesde 1982 hemos llevado a buen término proyectos que suman un total de más de 750.000 metros construidos y un valor de venta de más de 1.200 millones de euros.','ea91daca3517315d59181f9b4823414b','2023-06-24 11:14:58',1),(129,'CitiCasa','info@citicasa.es','952336342','https://www.citicasa.es','MÁLAGA, NUESTRA PASIÓN\r\nCada año, sin excepción, aportamos nuestro granito de arena a la ciudad con la que amanecemos cada día.\r\nHabituales colaboraciones radiofónicas, televisivas, campañas de visibilidad en EMT y METRO, incluso con el equipo de fútbol de nuestra ciudad.\r\nEn CITICASA siempre estaremos por y para nuestra querida MÁLAGA.','ea91daca3517315d59181f9b4823414b','2023-06-24 11:20:26',1),(130,'PlanetaCasa','huelin@planetacasa.net','697266609','https://www.planetacasa.net','Somos una empresa española fundada en 2009 tras la unión de empresarios y profesionales del sector inmobiliario y el sector financiero con más de 25 años de experiencia a sus espaldas.\r\nGrupo Planetacasa fue creado para dar solución a la crisis del sector inmobiliario nacional y como respuesta a la necesidad de los clientes que buscan comprar, vender o vivienda en Málaga, bajo un método de trabajo avalado por nuestra propia experiencia.','ea91daca3517315d59181f9b4823414b','2023-06-24 11:27:56',1),(131,'RedPiso','info@redpiso.com',' 915078237','https://www.redpiso.es','La misión del Grupo REDPISO es atender las necesidades de los clientes en relación al sector de la intermediación inmobiliaria y financiera, que residen en las áreas donde nos encontramos y que quieren alquilar, adquirir o vender una vivienda en las mejores condiciones, con la mejor financiación posible y bajo un trabajo profesional y de calidad. Y por otro lado, ofrecer un gran número de oportunidades de desarrollo personal y profesional a sus franquiciados y a sus empleados, sea cual sea su edad, sexo o nacionalidad.','ea91daca3517315d59181f9b4823414b','2023-06-24 11:36:01',1),(132,'Globbe International','info@globbe.com','952202413','https://www.globbe.com','Nuestro mayor líder en la empresa, es mi padre, D. Antonio M. Díaz Huettors, nos ha enseñado mucho durante este trayecto, tras muchas batallas día a día aprendemos cosas nuevas, por lo cual nos sentimos satisfecho de ello.\r\nSomos una pequeña empresa dedicada totalmente y volcada a todos nuestros clientes, ya sean compradores o vendedores.\r\nNos gusta sentarnos con ellos, que nos cuenten sus historias, sus alegrías, sus problemas y poder siempre ayudarles en todo lo posible. Nuestra transparencia es lo que nos destaca, nos gusta ver las cosas con perspectivas y con lógica.','ea91daca3517315d59181f9b4823414b','2023-06-24 11:40:26',1),(133,'Inmobiliaria Alianza Propiedades','info@alianzapropiedades.com','952040357 ','https://www.alianzapropiedades.com','ALIANZA PROPIEDADES es una empresa joven, dinámica y ágil que se adapta a los exigentes cambios del mercado y la sociedad, manteniéndose siempre cerca del cliente.\r\nNuestra experiencia y amplia formación técnica garantizan la máxima eficacia en cualquier tipo de gestión inmobiliaria.','ea91daca3517315d59181f9b4823414b','2023-06-24 11:44:48',1),(134,'Levy Inmobiliaria','info@levyinmobiliaria.es',' 691334447','https://www.levyinmobiliaria.es','Inmobiliaria LEVY es una agencia especializada en la gestión de alquiler y venta de activos inmobiliarios en Málaga y Provincia. Ésta se encuentra formada por un equipo humano multidisciplinar, compuesto por reconocidos profesionales en el sector. Nuestra amplia experiencia adquirida a lo largo de los años como agentes de la propiedad inmobiliaria, nos permite ofrecer un producto de excelencia y no solo para el cliente comprador sino también para nuestro cliente vendedor.','ea91daca3517315d59181f9b4823414b','2023-06-24 11:48:27',1),(135,'Casavida inmobiliaria','malaga@casavida.es','615665531','https://casavida.es','Casavida Inmobiliaria es uno de los proyectos más importantes de Grupo Presente Inversiones.\r\nCuenta con equipos formados por verdaderos profesionales especializados en la consultoría sobre compraventas y arrendamientos de inmuebles residenciales.','ea91daca3517315d59181f9b4823414b','2023-06-24 12:00:21',1),(136,'Audio Factory','info@audiofactory.com',' 608683935','https://www.audiofactory.es','Tienda de Alta Fidelidad y Cine en Casa en Málaga. Expertos en equipos de alta fidelidad y home cinema. Te asesoramos en Málaga para que encuentres tu equipo bajo marcas reconocidas del sector AV.','ea91daca3517315d59181f9b4823414b','2023-06-25 10:08:44',1),(137,'BaseDj','rogemusic@hotmail.com','699877549','https://www.basedj.es','Tienda de sonido Malaga, Tienda dj Malaga,Componentes Electronicos,Repuestos De Altavoces\r\nVenta de equipos de sonido e iluminacion, Etapas de potencia, Microfonos, Auriculares, Maquinas de humo, Laser RGB, Efectos Led, Reproductor de CD, Laser multipuntos, Monitores de Estudio, Megafonia para coches, Amplificadores de sonido, Repuestos de Altavoces, Giradiscos, Soportes y accesorios dj, controladores midi, Flash Strobo, Racks.\r\n\r\n','ea91daca3517315d59181f9b4823414b','2023-06-25 10:14:50',1),(138,'JC Valvular','jcvalvular@gmail.com','659153768','https://jcvalvular.com','Somos una empresa afincada en Málaga capital dedicada al sonid